import React, { useEffect, useState } from 'react';
import { Story } from '../api/storyService';
import * as storyService from '../api/storyService';

const StoryList: React.FC = () => {
  const [stories, setStories] = useState<Story[]>([]);
  const [name, setName] = useState('');
  const [description, setDescription] = useState('');
  const [priority, setPriority] = useState<'low' | 'medium' | 'high'>('low');
  const [project, setProject] = useState('');
  const [ownerId, setOwnerId] = useState('');

  useEffect(() => {
    fetchStories();
  }, []);

  const fetchStories = async () => {
    try {
      const data = await storyService.getAll();
      setStories(data);
    } catch (error) {
      console.error('Error fetching stories:', error);
    }
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    const newStory: Omit<Story, 'id'> = {
      name,
      description,
      priority,
      project: parseInt(project), // Convert string to number
      ownerId: parseInt(ownerId), // Convert string to number
      status: 'todo',
      createdAt: new Date(),
    };
    try {
      await storyService.add(newStory as Story);
      await fetchStories(); // Refresh the list after adding
      setName('');
      setDescription('');
      setPriority('low');
      setProject('');
      setOwnerId('');
    } catch (error) {
      console.error('Error adding story:', error);
    }
  };

  const handleDeleteStory = async (id: number) => {
    try {
      await storyService.remove(id.toString()); // Convert number to string
      await fetchStories(); // Refresh the list after deleting
    } catch (error) {
      console.error('Error deleting story:', error);
    }
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Story Management</h1>
      <form onSubmit={handleSubmit} className="space-y-4 bg-white p-4 rounded shadow-md mb-6">
        <div>
          <label htmlFor="story-name" className="block text-sm font-medium text-gray-700">Story name:</label>
          <input type="text" id="story-name" value={name} onChange={e => setName(e.target.value)} required className="mt-1 block w-full p-2 border border-gray-300 rounded" />
        </div>
        <div>
          <label htmlFor="story-description" className="block text-sm font-medium text-gray-700">Story description:</label>
          <input type="text" id="story-description" value={description} onChange={e => setDescription(e.target.value)} required className="mt-1 block w-full p-2 border border-gray-300 rounded" />
        </div>
        <div>
          <label htmlFor="story-priority" className="block text-sm font-medium text-gray-700">Priority:</label>
          <select id="story-priority" value={priority} onChange={e => setPriority(e.target.value as 'low' | 'medium' | 'high')} required className="mt-1 block w-full p-2 border border-gray-300 rounded">
            <option value="low">Low</option>
            <option value="medium">Medium</option>
            <option value="high">High</option>
          </select>
        </div>
        <div>
          <label htmlFor="story-project" className="block text-sm font-medium text-gray-700">Project:</label>
          <input type="text" id="story-project" value={project} onChange={e => setProject(e.target.value)} required className="mt-1 block w-full p-2 border border-gray-300 rounded" />
        </div>
        <div>
          <label htmlFor="story-ownerId" className="block text-sm font-medium text-gray-700">Owner ID:</label>
          <input type="text" id="story-ownerId" value={ownerId} onChange={e => setOwnerId(e.target.value)} required className="mt-1 block w-full p-2 border border-gray-300 rounded" />
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded">Add Story</button>
      </form>
      <div className="space-y-4 bg-white p-4 rounded shadow-md">
        {stories.map(story => (
          <div key={story._id} className="border-b py-2">
            <h2 className="text-lg font-bold">{story.name}</h2>
            <p>{story.description}</p>
            <p className="text-sm text-gray-500">Priority: {story.priority}</p>
            <p className="text-sm text-gray-500">Status: {story.status}</p>
            <button onClick={() => handleDeleteStory(story._id!)} className="bg-red-500 text-white p-2 rounded">Delete</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default StoryList;
